// import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <div className='navigator'>
        <div>
          <h1>Movies</h1>
        </div>

        <div>
          <form>
           <input />
           <button>Search Box </button>
          </form>
        </div>

        <div className='movienames'></div>

      </div>

    </div>
  );
}

export default App;
